                  - type: paragraph
                    content:
                      - type: text
                        text: 'The '
                      - type: text
                        marks:
                          - type: em
                        text: Communications Regulation Commission (CRC)
                      - type: text
                        text: >-
                          , Sofia, announces that since 10 January 2011 a closed
                          dialling for call realization of the national
                          (significant) number, including the national
                          destination code, is always used regardless of whether
                          the calling and the called subscribers are located
                          within a single location or in different locations.
                          The dialling of the prefix “0” will be kept as well.
                          Thus the transition from open to closed dialling will
                          lead to a change only in the dialling within the same
                          geographical code, since at the time being in case of
                          long distance dialling and dialling to mobile and
                          non-geographic numbers, the whole national significant
                          number and prefix “0” are used.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          The following update to the National Numbering Plan
                          (NNP) for Bulgaria.
